import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { NavLink } from "react-router-dom";
import "../assets/css/nucleo-icons.css";
import "../assets/css/nucleo-svg.css";
import "../assets/css/textanimate.css";
import "../assets/css/argon-dashboard.css?v=2.0.4";
function BusinessType() {
  const images = importAll(
    require.context("../assets/img/", false, /\.(png|jpe?g|svg)$/)
  );

  function importAll(r) {
    let images = {};
    r.keys().map((item, index) => {
      images[item.replace("./", "")] = r(item);
    });
    return images;
  }
  const [getuserdata, setUserdata] = useState([]);
  console.log(getuserdata);

  const Navigate = useNavigate();
  const [name, setName] = useState("");
  const [url, setUrl] = useState("");
  const [image, setImage] = useState("");
  const handleFileChange = (e) => {
    const img = {
      preview: URL.createObjectURL(e.target.files[0]),
      data: e.target.files[0],
    };
    setImage(img);
  };

  async function addRecord(event) {
    event.preventDefault();

    const formData = new FormData();
    formData.append("image", image);
    formData.append("name", name);
    const response = await fetch(
      "http://localhost:1337/api/businesstype",
      formData,
      {
        method: "POST",
        headers: { "Content-Type": "multipart/form-data" },
      }
    );
    console.log(response.data);
    const data = await response.json();

    if (data.status === "ok") {
      window.location.href = "/add";
    }
  }

  const getdata = async () => {
    const res = await fetch("http://localhost:1337/businesstype/getdata", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    });

    const data = await res.json();
    console.log(data);

    if (res.status === 422 || !data) {
      console.log("error ");
    } else {
      setUserdata(data);
      console.log("get data");
    }
  };

  useEffect(() => {
    getdata();
  }, []);

  const deleteuser = async (id) => {
    const res2 = await fetch(
      `http://localhost:1337/businesstype/deleteuser/${id}`,
      {
        method: "DELETE",
        headers: {
          "Content-Type": "application/json",
        },
      }
    );

    const deletedata = await res2.json();
    console.log(deletedata);

    if (res2.status === 422 || !deletedata) {
      console.log("error");
    } else {
      console.log("user deleted");
      // setDLTdata(deletedata)
      getdata();
    }
  };
  const imagehandler = () => {
    const data = new FormData();
    data.append("upload_preset", "mern-crud");
    data.append("file", image);

    data.append("cloud_name", "dx6ro5dgg");

    //   const config = {
    //     method: "POST",
    //     body: data
    // };
    //   var imgurl = "https://api.cloudinary.com/v1_1/dx6ro5dgg/image/upload";

    //   fetch(imgurl, config)
    //    .then(responseData => {
    //              console.log(JSON.stringify(responseData, null, 4));
    //    })

